        public static string GetRankFromRating(double rating)
        {
            if (rating > 1500)
                return "Megastriker";
            else if (rating >= 1395)
                return "Legend III";
            else if (rating >= 1295)
                return "Legend II";
            else if (rating >= 1195)
                return "Legend I";
            else if (rating >= 1094)
                return "Superstar III";
            else if (rating >= 1011)
                return "Superstar II";
            else if (rating >= 934)
                return "Superstar I";
            else if (rating >= 852)
                return "Professional III";
            else if (rating >= 771)
                return "Professional II";
            else if (rating >= 693)
